```javascript
import React from 'react';
import { useMutation } from '@apollo/client';
import { ADD_DATA } from './mutations';

function MyForm() {
  const [addData, { data, loading, error }] = useMutation(ADD_DATA);

  const onSubmit = async (event) => {
    event.preventDefault();

    const formData = new FormData(event.target);
    const variables = Object.fromEntries(formData);

    try {
      const response = await addData({ variables });
      console.log(response);
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <form onSubmit={onSubmit}>
      {/* form fields go here */}
      <button type="submit">Submit</button>
    </form>
  );
}

export default MyForm;
```
In this example, we're using the `useMutation` hook from Apollo Client to execute a GraphQL mutation. The `ADD_DATA` constant is a GraphQL mutation that you would define elsewhere in your code.

The `onSubmit` function is called when the form is submitted. It prevents the default form submission behavior, extracts the form data into an object, and then calls the `addData` function with the form data as variables.

