1. Static Variables:
A static variable is a variable that has been allocated statically, i.e., at compile time. It retains its value between function calls and is initialized only once. Static variables are declared using the keyword "static".

Here are some properties of static variables:

* They are initialized only once and retain their value between function calls.
* They have a default value of zero if not explicitly initialized.
* They have a local scope, i.e., they are only accessible within the function in which they are declared.
* They are stored in the data segment of the program's memory.

Example:
```c
#include <stdio.h>

void increment() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}
```
Output:
```
Count: 1
Count: 2
Count: 3
```
In the above example, the variable "count" is declared as static inside the function "increment". It is initialized to 0 only once and retains its value between function calls.

2. Register Variables:
A register variable is a variable that is stored in a register instead of RAM. Registers are a type of high-speed memory that is built into the CPU. Register variables are declared using the keyword "register".

Here are some properties of register variables:

* They are stored in the CPU registers instead of RAM.

