 Sure, I'd be happy to help! Here are a few popular compiler optimization techniques:

1. Constant Propagation: This technique involves replacing a variable with a constant value if the variable's value is known at compile time.

Example:
```c
int x = 5;
int y = x + 3;
```
After optimization:
```c
int y = 8;
```

2. Dead Code Elimination: This technique involves removing code that does not affect the program's output.

Example:
```c
int x = 5;
int y = x + 3;
x = 10;
```
After optimization:
```c
int y = 8;
```

3. Loop Unrolling: This technique involves replicating the loop body multiple times to reduce the number of iterations and improve performance.

Example:
```c
for (int i = 0; i < 10; i++) {
    x += i;
}
```
After optimization:
```c
for (int i = 0; i < 10; i += 4) {
    x += i;
    x += i + 1;
    x += i + 2;
    x += i + 3;
}
```

4. Function Inlining: This technique involves replacing a function call with the function's body to reduce the overhead of the function call.

Example:
```c
int add(int a, int b) {
    return a + b;
}

int x = add(5, 3);
```
After optimization:
```c
int x = 5 + 3;
```

5. Common Subexpression Elimination: This technique involves identifying expressions that are computed multiple times with the same input values and replacing them with a single computation.

Example:
```c
int x = a * b;
int y = a * b + c;
```
After optimization:
```c
int x = a * b;
int y = x + c;
```

