Here's a simple function that calculates the elapsed time since a post was made and returns it in a human-readable format. This function uses the built-in Date object in JavaScript and assumes that the input is a valid date string.

```typescript
function getElapsedTime(postDate: string): string {
  const postTime = new Date(postDate).getTime();
  const currentTime = new Date().getTime();
  const elapsedTime = currentTime - postTime;

  const seconds = Math.floor((elapsedTime / 1000) % 60);
  const minutes = Math.floor((elapsedTime / 1000 / 60) % 60);
  const hours = Math.floor((elapsedTime / (1000 * 60 * 60)) % 24);
  const days = Math.floor(elapsedTime / (1000 * 60 * 60 * 24));

  if (days > 0) {
    return `${days} day(s) ago`;
  } else if (hours > 0) {
    return `${hours} hour(s) ago`;
  } else if (minutes > 0) {
    return `${minutes} minute(s) ago`;
  } else {
    return `${seconds} second(s) ago`;
  }
}

// Usage
const postDate = "2022-01-01T12:00:00Z";
console.log(getElapsedTime(postDate));
